            <h3 className="cart-login__form-container__title-2">Don't have an account?</h3>
            <div className="cart-login__form-container__buttons">
            <button className="cart-login__form-container__buttons__sign-up">Sign up</button>
            <button className="cart-login__form-container__buttons__guest">Continue as guest</button>
            </div>
            </div>
        </div>
    )
  }

}   

  export default CartLogin;
